import React from 'react';
/**
 * Simple component with no state.
 *
 * See the basic-react from lecture 11 for an example of adding and
 * reacting to changes in state and lecture 16 for details on Material-UI
 *
 * @return {object} JSX
 */
const TextContext = React.createContext();

function App() {
  const [text, setText] = React.useState('One');
  const changeText = () => {
    setText(text == 'One' ? 'Two' : 'One');
  };
  return (
    <div>
      <TextContext.Provider value = {{text, changeText}}>
        <ButtonBar/>
      </TextContext.Provider>
    </div>
  );
}

function ButtonBar() {
  return (
    <div>
      <TextButton/>
      <TextButton/>
      <TextButton/>
    </div>
  );
}

function TextButton() {
  return(
    <TextContext.Consumer>
      {({text, changeText}) => (
        <button onClick={changeText}>{text}</button>
      )}
    </TextContext.Consumer>
  );
}
export default App;
